INSERT INTO `chapitre` (`idChapitre`, `titre`, `niveau`, `ordre`, `contenu`, `idModule`) VALUES
(2, 'Les bases la programmation en C', 'L2', 2, '<span style="background-color: rgb(235, 235, 235);">Chap.1:</span><h1 style="text-align: center;"><b><u><font color="#ff0000" style="background-color: rgb(235, 235, 235);">INTRODUCTION A LA PROGRAMMATION</font></u></b></h1><div><h3 id="r-3012712" data-claire-element-id="7346002" style="color: rgb(84, 84, 84); margin: 0px 0px 10px; font-size: 1.375rem; line-height: 2rem; font-family: Aileron;"><u><i style="background-color: rgb(235, 235, 235);">Un programme, c''est quoi ?</i></u></h3><p id="r-2986216" data-claire-element-id="4179851" style="font-size: 1.125rem; line-height: 1.75rem; color: rgba(0, 0, 0, 0.85); margin: 0px 0px 15px; box-sizing: border-box; font-family: Aileron;"><span style="background-color: rgb(235, 235, 235);">Depuis son invention dans les années 1950, l''informatique a révolutionné bien des domaines&nbsp;de notre vie quotidienne. Le calcul d''un itinéraire depuis un site Internet ou un <b style="">GPS</b>, la réservation&nbsp;à distance d''un billet de train ou d''avion ou encore la possibilité de voir et de parler avec des amis&nbsp;à l''autre bout du monde : tous ces actes courants sont possibles grâce aux&nbsp;<span style="color: inherit; font-weight: 900;">ordinateurs</span>.</span></p></div>', 2),
(3, 'Introduction à l''algorithme', 'L1', 1, '', 12);

-- --------------------------------------------------------

--
-- Structure de la table `classe`
--

CREATE TABLE IF NOT EXISTS `classe` (
  `idClasse` int(11) NOT NULL AUTO_INCREMENT,
  `codeClasse` varchar(25) NOT NULL,
  PRIMARY KEY (`idClasse`),
  UNIQUE KEY `codeClasse` (`codeClasse`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 AUTO_INCREMENT=1 ;

-- --------------------------------------------------------

--
-- Structure de la table `etudiant`
--

CREATE TABLE IF NOT EXISTS `etudiant` (
  `idEtu` int(11) NOT NULL AUTO_INCREMENT,
  `nom` varchar(30) NOT NULL,
  `prenom` varchar(30) NOT NULL,
  `idClasse` int(11) NOT NULL,
  PRIMARY KEY (`idEtu`),
  KEY `idClasse` (`idClasse`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 AUTO_INCREMENT=1 ;

-- --------------------------------------------------------

--
-- Structure de la table `evaluation`
--

CREATE TABLE IF NOT EXISTS `evaluation` (
  `idEv` int(11) NOT NULL AUTO_INCREMENT,
  `datEv` varchar(9) NOT NULL,
  `libellEv` varchar(250) NOT NULL,
